import React, { useEffect, useState } from 'react';
import axios from 'axios';


interface Diary {
  id: number,
  date: string,
  weather: string,
  visibility: string
}

const baseUrl = 'http://localhost:3000/api/diaries'


const Diary = ( { diary }: { diary: Diary } ) => {

  return (
    <div>
      <b>{diary.date}</b><br />
{diary.weather}<br />
{diary.visibility}<br />
    </div>
  )
}

const App = () => {
const [diaries, setDiaries] = useState<Diary[]>([])


  useEffect(() => {
axios
.get<Diary[]>(`${baseUrl}`)
.then(response => {
  setDiaries(response.data)
})
  })

  return (
<div>
      <h2>Diary entries</h2>
  {
    diaries.map(diary => (
      <Diary key={diary.id} diary={diary} />
    ))
  }
</div>
  )
}

export default App;
